import React, {Component} from 'react';
import './Section.css';

class Section extends Component {
  render() {
    return (
      <div className="Section row">
        <SectionImage link={this.props.image} alt={this.props.alt}/>
        <SectionText>
          {this.props.children}
        </SectionText>
      </div>
    );
  }
}


class SectionImage extends Component {
  render() {
    return (
      <img className="SectionImage col-4" src={this.props.link} alt={this.props.alt}/>
    );
  }
}


class SectionText extends Component {
  render() {
    return (
      <div className="SectionText col-8">
        {this.props.children}
      </div>
    );
  }
}

export default Section;
